import React from 'react';
import '../../App.css';
import './topCard.css'

const TopCard = ({ val }) => {
  console.log(val);
  return (
    <div className="topCardContainer" id={val.idMeal}>
      <div>
        {/* <img src={val.strMealThumb} alt={val.strMeal}/> */}
        <h1><span>{val.strCategory.toLowerCase() === "beef"  || val.strCategory.toLowerCase() === 'Chicken' || "Goat" || 'Lamb' || 'Pork' || 'Seafood' ? <img src='https://www.nabeeats.com/assets/images/non-veg.png' alt='Non Veg' /> : <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTsT4e0RN6IsWAPDRX2etbSZ0vEHSj9dwZ6mxLylkpApzXblEDfu6uzg0Xd6sIK5xwhvok&usqp=CAU' alt='Veg' />}</span>{val.strMeal}</h1>
        <h4> {val.price} <span>{val.price + 50}</span> </h4>
        <button > Add to Cart</button>
        <button > Remove from Cart</button>
      </div>
    </div>
  )
}

export default TopCard
